import React from "react";
import { Row, Col, Form } from "react-bootstrap";

const DateTime = () => {
  return (
    <Row>
      <Col>
        <Form className="d-flex justify-content-center">
          <Form.Group>
            <Form.Control
              size="lg"
              type="date"
              style={{ paddingRight: "2rem" }}
            />
          </Form.Group>
          <Form.Group>
            <Form.Control
              size="lg"
              type="time"
              style={{ paddingLeft: "2rem" }}
            />
          </Form.Group>
        </Form>
      </Col>
    </Row>
  );
};

export default DateTime;
